export const getEvents = (locat) => {
    let myHeader = new Headers();
    myHeader.append("Access-Control-Allow-Origin", "*");
    myHeader.append("API_Key", "HkgwXkPs5xHpDpR2");
    return fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2", {
        headers: myHeader,
        cache: "no-cache"
    }).then((res) => {
        console.log(res);
    });
}
